 import './index.css'
 class Speedometer extends Component{
    state ={}
    render()
    {

        return(
            <div>
                <h1>SPEEDOMETER</h1>

                <img src="https://assets.ccbp.in/frontend/react-js/speedometer-img.png" alt=".avatar"/>

                <h1>Speed id 0mph</h1>
                <p>Min Limit is 0mph,Max Limit is 200mph</p>
                <div>
                    <button className="button1" id="b1" onClick={accelerate}>Accelerate</button>
                    <button className="button1" onClick={brake}>Apply Brake</button>
                </div>
            </div>
        )
    }
 }

 export default Speedometer;
